import React from 'react';
import { Box, Card, Typography, TextField, Button } from '@mui/material';

const WritePost = (props) => {
  return (
    <Box sx={{
        boxSizing : 'border-box',
        padding : '10px',
        width : '100%',
        height : '1100px',
    }}>
        <Card
            component='div'
            sx={{
                boxSizing : 'border-box',
                padding : '20px',
                width : '100%',
                height : '100%',
                borderRadius : '10px',
                boxShadow : '0px 0px 5px gray'
        }}>
            <form action='/add' method='POST'>
              <TextField name='title' fullWidth  label='글 제목' variant='outlined' />
              <TextField name='post' fullWidth  label='글 본문' variant='outlined' />
              <Button type='submit'>버튼</Button>
            </form>
        </Card>
    </Box>
  )
}

export default WritePost;
